{"id":"TraitSelectorQuery","query":"query TraitSelectorQuery(
  $collectionSlug: CollectionSlug
  $withTraitFloor: Boolean
) {
  collection(collection: $collectionSlug) {
    ...TraitSelector_data_4zPn1c
    id
  }
}

fragment TraitSelector_data_4zPn1c on CollectionType {
  statsV2 {
    totalSupply
  }
  stringTraits(withTraitFloor: $withTraitFloor) {
    key
    counts {
      count
      value
      floor {
        eth
        unit
        symbol
        usd
      }
    }
  }
}
","variables":{"collectionSlug":"heroes-of-evermore","withTraitFloor":true}}

